import './App.css';
import HeadBar from '../src/components/HeadBar.js';
import Elip from '../src/components/Elip.js';
import Unsere from './components/Unsere';
import Habe from './components/Habe';
import Der from "./components/Der"

function App() {
  return (
    <div className="App">
      <div className="Top">
        <HeadBar/>
      </div>
      <div className="elip">
        <Elip/>
      </div>
      <div className="Unsere">
      <Unsere/>
      </div>
      <div className="Habe">
       <Habe/>
      </div>
      <div className="Der">
       <Der/>
      </div>
    </div>
  );
}

export default App;
